import axios from 'axios'
import {saveShip} from './../../utils/saveShip'

export default class SaveShip extends Component {
    render() {
        return (
            <button onClick={() => saveShip(this.props.stage, this.props.name,  this.props.locationStatus, this.props.bodyLocation)}> Save </button> 
        );
    }
}
